import React, { Component } from "react";
import Category_items2 from "./Category_items2";
import "../../scss/category2.scss";
export class Category2 extends Component {
  render() {
    return (
      <div className="split_categorys">
        <div>
          <div className="category_half_r">
            <h2>Kategorija:</h2>
          </div>
          <div className="linebreak2"></div>
          <div>
            <Category_items2 />
          </div>
        </div>

        <div className="category_half_l">
          <div className="category_name">
            <h2>Kategorija:</h2>
          </div>
          <div className="linebreak2"></div>
          <div>
            <Category_items2 />
          </div>
        </div>
      </div>
    );
  }
}

export default Category2;
